import React from 'react';
import faq from './img/faq.png';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

function Faq() {
    return(
        <React.Fragment>
            <div className='faq'>
                <h1> Frequently Asked Questions (FAQ): </h1>
                <img id='faqImage' src= {faq} />
            </div>
        </React.Fragment>
    )
}

export default Faq;
